import React from 'react'

const HomeScreen = () => {
  return (
    <>
      <a href='/pomodoro'>POMODORO</a>
      <a href='/login'>LOGIN</a>
      <a href='/register'>REGISTER</a>
    </>
  )
}

export default HomeScreen
